import React from 'react';
import './App.css';

const App = () => {
  return(
      <div className="top-background">
          <form>
              <label>Login</label>
              <input type="text" placeholder="Login"/>
              <label>Password</label>
              <input type="password" />
          </form>
      </div>

  );
};
export default App;
